import React, { useState } from "react";
import { Container, Grid , Button, Typography  ,TextField} from "@material-ui/core";
import { DataGrid } from '@material-ui/data-grid';
import ModalModel from "./components/modalModel";

const ModelConfig =()=>{
    const [ modelId, setModelId] = useState(0);
    const [ openLine, setOpenLine ] = useState(false);
    const [ rows, setRows] = useState([]);

    const columns = [
        { field: 'id', headerName: 'ID', width: 90 },
        { field: 'firstName', headerName: 'Descripción', width: 250},
        { field: 'edit', headerName: 'Editar', width: 160,
            renderCell: (params) => (
                <strong>
                    <Button
                        variant="contained"
                        size="small"
                        color="secondary"
                        style={{ marginLeft: 16 }}
                        onClick={''}

                    >
                        Editar
                  </Button>
                </strong>
            ),
        }
      ];

      const handleOpenLine =()=>{
        setOpenLine(!openLine);
      }

      const onclickbutton =()=>{
        handleOpenLine();
      }

    return(
        <Container maxWidth>
            <Grid container spacing={2}>
                <Grid item xs={12}> 
                <Typography style={{textAlign :"center"}} variant={'h3'}> Modelos</Typography>

                </Grid>
                <Grid item xs={8}>
                 <TextField fullWidth label="Descripción" variant="outlined" />
                </Grid>
                <Grid item xs={2}>
                    <Button  fullWidth variant="contained">Buscar</Button>
                </Grid>
                <Grid item xs={2}>
                    <Button onClick={onclickbutton} fullWidth variant="contained">Nuevo</Button>
                    <ModalModel isOpen={openLine} handleClose={handleOpenLine} modelId={modelId} />
                </Grid>
                <Grid item xs={12}>
                <div style={{ height: 400, width: '100%' }}>
                    <DataGrid
                        rows={rows}
                        columns={columns}
                        pageSize={5}
                        onSelectionModelChange={(newselection) =>{
                            setModelId(newselection.selectionModel[0]);
                        }}  
                    />
                    </div>
                  </Grid>
            </Grid>
        </Container>
    );
}

export default ModelConfig;
